export function lengthOfLongestSubstring(s: string): number {
  return s.split('').reduce((totalMax, _, i, a) => {
    if (totalMax > a.slice(i).length) {
      return totalMax;
    } else {
      const current = a.slice(i).reduce(
        ({ sequence, max }, char) => {
          const isIncluded = sequence.includes(char);
          const newSequence = isIncluded ? [char] : sequence.concat(char);
          const newMax = Math.max(
            max,
            isIncluded ? sequence.length : newSequence.length,
          );
          return {
            sequence: newSequence,
            max: newMax,
          };
        },
        { sequence: [], max: 0 } as { sequence: string[]; max: number },
      );
      return Math.max(totalMax, current.max);
    }
  }, 0);
}

